import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  NavLink
} from "react-router-dom";
import {routes} from '../data/SideNavItems'
import './Products.css'
export default function Products() {


  return (

    <Router>
      <div style={{ display: "flex" }}>
        <div class='sidenav'
        >
          <ul style={{ listStyleType: "none", padding: 0 }}>
            <li>
              <NavLink to="/products/view">View Details</NavLink>
            </li>
            <li>
              <Link to="/products/add">Add Products</Link>
            </li>
            <li>
              <Link to="/products/delete">Delete Products</Link>
            </li>
            <li>
              <Link to="/products/update">Update Products</Link>
            </li>
          </ul>
        </div>

        <div class='main'>
          <Switch>
            {routes.map((route, index) => (
              <Route
                key={index}
                path={route.path}
                exact={route.exact}
                children={<route.main/>}
              />
            ))}
          </Switch>
        </div>
      </div>
    </Router>
  );
}
